-- ------------------------------------------------
-- Version: v1.0
--
-- Description: Migration that introduces the manager provider relationship
-- -------------------------------------------------

CREATE TABLE k_Manager (
    lodMAN character varying(255) NOT NULL,
    MAN character varying(255),
    labelManager character varying(255),
    descManager text,
    lodMAN_V character varying(255),
    Certification text,
    Country text,
    startDate timestamp with time zone,
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodMAN)
);

CREATE TABLE k_Provider (
    IDPRV integer,
    lodPRV character varying(255) NOT NULL,
    PRV character varying(255),
    labelProvider character varying(255),
    descProvider text,
    lodTPR character varying(255),
    lodPRV_V character varying(255),
    Country text,
    startDate timestamp with time zone,
    populatedBy character varying(255),
    lastTouch date,
    PRIMARY KEY (lodPRV)
);

CREATE TABLE k_Identifier (
    IDIDN integer,
    lodIDN character varying(255) NOT NULL,
    IDN character varying(255),
    labelIdentifier character varying(255),
    descIdentifier text,
    lodIND_V character varying(255),
    startDate timestamp with time zone,
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodIDN)
);

CREATE TABLE k_Manager_Provider (
     ID_MAN_PRV integer,
     lodMAN character varying(255) NOT NULL,
     lodRelation character varying(255),
     lod_PRV  character varying(255) NOT NULL,
     lod_IDN character varying(255) NOT NULL,
     ID_MAN_PRV_V  integer,
     populatedBy  character varying(255),
     lastTouch  character varying(255),
     PRIMARY KEY (lodMAN, lod_PRV, lod_IDN),
     FOREIGN KEY (lodMAN) REFERENCES k_Manager(lodMAN) ON DELETE CASCADE,
     FOREIGN KEY (lod_PRV) REFERENCES k_Provider(lodPRV) ON DELETE CASCADE,
     FOREIGN KEY (lod_IDN) REFERENCES k_Identifier(lodIDN) ON DELETE CASCADE
);

