INSERT INTO k_Identifier (IDIDN, lodIDN, IDN, labelIdentifier, descIdentifier, lodIND_V, STartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:C2BEAE031', 'GePRIS', 'GePRIS', 'Identifies authors by the first 2-4 letters of their surname plus numbers (e.g. XX 1234 or YY 67) generated by Elektra, the DFG''s internal administrative grant-processing procedure. This disambiguation is for DFG''s internal processes only.', NULL, NULL, '0000-0002-0255-5101', '30/01/2024');
