INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:C496EAD7', NULL, 'Austrian National Library', NULL, 'pid_graph:DB893DE8', NULL, 'AUT', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:650F2243', NULL, 'KBR (Royal Library of Belgium)', 'The Royal Library of Belgium is the national scientific library in Belgium. It collects all Belgian publications and preserves, manages and studies an extensive cultural and historical heritage. It provides the public with access to information, facilitates research and offers a broad cultural experience.', 'pid_graph:DB893DE8', NULL, 'BEL', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:F6308707', NULL, 'Câmara Brasileira do Livro (CBL)', 'Brazilian Book Chamber (CBL) is a non-profit association, representing publishers, booksellers, distributors, and other professionals in the sector. CBL promotes access to books and the democratization of reading throughout the country, as well as promoting Brazilian literature in the international market.', 'pid_graph:DB893DE8', NULL, 'BRA', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:0744D7A2', NULL, 'Bibliothèque et Archives nationales du Québec (BAnQ)', 'Bibliothèque et Archives nationales du Québec (BAnQ) collects, processes, preserves and promotes the Quebec documentary heritage and a vast collection of documents in all fields. It provides the services of a major public library to the entire population of Quebec.', 'pid_graph:DB893DE8', NULL, 'CAN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:0320244D', NULL, 'China Knowledge Centre for Engineering Sciences and Technology (CKCEST)', 'The China Knowledge Centre for Engineering Sciences and Technology (CKCEST) utilises the digital resources of relevant universities, research institutes, enterprises and other entities across the country to establish a knowledge centre featuring rich resources with strong practicality and a broad scope of application. ', 'pid_graph:DB893DE8', NULL, 'CHN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:C794C66B', NULL, 'Chinese DOI', 'Chinese DOI is a DOI registration service jointly run by ISTIC & Wanfang Data, and it was the first DOI RA in China and Asia. It mainly provides DOI registration, resolution and other value-added services to Chinese publishers, research institutions, service providers and researchers for research content such as academic journals, scientific data, dissertations, books, conference proceedings, preprints, etc. ISTIC (Institute of Science and Technology Information of China) is a national public beneficial research institute under the Ministry of Science and Technology of China, and Wanfang Data (Wanfang Data Co., Ltd. & Wanfang Data CORP. (INTL) LTD) is the leading science and technology information service provider in China.', 'pid_graph:DB893DE8', NULL, 'CHN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:F29743FC', NULL, 'CNIC', 'The Computer Network Information Center (CNIC) of the Chinese Academy of Sciences (CAS) provides research network, data, computing, resource planning services to the scientific communities, and Internet-based science outreach service to the general public.', 'pid_graph:DB893DE8', NULL, 'CHN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:FCECC2D2', NULL, 'CNKI', 'China National Knowledge Infrastructure (CNKI) manages China-based information resources, including Chinese politics, economics, humanities, social science, science, and technology. CNKI publishes databases containing e-journals, newspapers, dissertations, proceedings, yearbooks, references', 'pid_graph:DB893DE8', NULL, 'CHN', NULL, '0009-0006-1756-5317', '2024-08-20');
