INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:D1DB7F9F', NULL, 'DKRZ', 'The German Climate Computing Center (Deutsches Klimarechenzentrum, DKRZ) is a central service center for German climate and earth system research. Its high performance computers, data storage and services form the central research infrastructure for simulation-based climate science in Germany. ', 'pid_graph:DB893DE8', NULL, 'DEU', NULL, '0009-0006-1756-5317', '2024-08-20');
