INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:65A98C52', NULL, 'National Széchényi Library', NULL, 'pid_graph:DB893DE8', NULL, 'HUN', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:E680F29D', NULL, 'Library of Trinity College Dublin, University of Dublin', 'The Library of Trinity College Dublin supports the learning and research needs across all disciplines of the college. It is a major research library providing services to a wide range of external users and institutions. It contributes to the development of creative initiatives in information provision and its exhibitions of manuscripts and other treasures attracts hundreds of thousands of visitors to visit the Old Library each year.', 'pid_graph:DB893DE8', NULL, 'IRE', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:C6D924E8', NULL, 'Italian Central Institute for Cataloguing and Documentation (ICCU)', NULL, 'pid_graph:DB893DE8', NULL, 'ITA', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:B09F8820', NULL, 'JaLC', 'The Japan Link Center (JaLC) provides public information services to promote science and technology in Japan. Scientific and academic metadata and content from holders nationwide, including national institutes, universities, government organisations, and commercial publishers. Operated by Japan Science and Technology Agency, National Institute of Material Science, National Institute of Informatics, and National Diet Library. Collaboration with Crossref and DataCite for global distribution.', 'pid_graph:DB893DE8', NULL, 'JPN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:33A4BB68', NULL, 'KISTI', 'The Korean DOI Center is operated by the Korea Institute of Science and Technology Information (KISTI). They collect bibliographic information of Korean science and technology information and data, including journal articles, proceedings, official Government documents, Korean patent information, R&D Reports and traditional Korean knowledge. In addition, the Korean DOI Center promotes the use of the collected information and data in Korea and improve access to Korean research achievements.', 'pid_graph:DB893DE8', NULL, 'KOR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:32BB916F', NULL, 'National Assembly Library of Korea', 'The National Assembly Library of Korea is the largest humanities and social sciences library in the country, and functions as both a parliamentary and public library. It was established to collect a wealth of information from around the world and deliver it to both the members of the National Assembly and the general public.', 'pid_graph:DB893DE8', NULL, 'KOR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:8C3ABE90', NULL, 'National Library of Korea', 'The National Library of Korea is a dynamic hub for knowledge, research, and lifelong learning. It maintains an online catalogue, digital archives, and various educational and cultural programs.', 'pid_graph:DB893DE8', NULL, 'KOR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:AF8DFCEF', NULL, 'National Research Foundation of Korea (NRF)', NULL, 'pid_graph:DB893DE8', NULL, 'KOR', NULL, '0009-0006-1756-5317', '2025-01-19');
