INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:D2D0AB0F', NULL, 'Bibliothèque nationale de Luxembourg', 'The Bibliothéque Nationale de Luxembourg collects, catalogues and preserves all analogue and digital publications published in Luxembourg and any works published abroad that relate to the Grand Duchy. It is the country’s leading academic, research and cultural heritage library. In order to meet the requirements of its users, about three-quarters of its printed collections come from other countries and they cover different fields of knowledge.', 'pid_graph:DB893DE8', NULL, 'LUX', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:DA6693BF', NULL, 'Koninklijke Bibliotheek', 'The KB is the National Library of the Netherlands. Its aim is to collect as many publications as possible written in or about the Netherlands. The library is comprised of a repository in The Hague and an extensive digital collection. It also hosts services such as the Online Library, Delpher and DBNL (the Digital Library for Dutch Literature).', 'pid_graph:DB893DE8', NULL, 'NLD', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:9F6AC0F7', NULL, 'Royal Library of the Netherlands', NULL, 'pid_graph:DB893DE8', NULL, 'NLD', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:012DA850', NULL, 'SURF', 'SURF is the collaborative ICT organisation for higher education and research in the Netherlands', 'pid_graph:DB893DE8', NULL, 'NLD', NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:B7D3F8B5', NULL, 'New Zealand Companies Office', NULL, 'pid_graph:DB893DE8', NULL, 'NZL', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:14EA6178', NULL, 'National Library of Norway', 'The National Library of Norway serves as Norway’s national memory. The collection is home to Norwegian knowledge and heritage with a physical location in Solli and an online repository. The services of the library are free and open to the public. ', 'pid_graph:DB893DE8', NULL, 'NOR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:79DB44B8', NULL, 'National Library of Poland', 'The National Library of Poland acts as the central library of the country and is one of the most important cultural institutions in Poland. Its mission is to protect national heritage preserved in the form of handwritten, printed, electronic, recorded sound and audiovisual documents. The primary task of the National Library of Poland is to acquire, store and permanently archive the intellectual output of Poles, including the works of citizens living on Polish soil, the most important foreign works, and publications related to Poland and published abroad.', 'pid_graph:DB893DE8', NULL, 'POL', NULL, '0009-0006-1756-5317', '2024-08-20');
