INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:7AA2E7F6', NULL, 'Swiss National Library', NULL, 'pid_graph:DB893DE8', NULL, 'CHE', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:F23932AE', NULL, 'Airiti', 'Airiti DOI is a Taiwan-based registration agency operated by Airiti, which is a service provider deeply involved in the scholarly community of the Chinese-speaking area. They manage applications to Chinese and English materials, incorporating the DOI into the digital publishing process, saving time and money for their members and partners. In addition to DOI registration services, Airiti DOI also develops and provides value-added services that support academic publishing, such as DOI Resolution, DOI Data Finder (search DOI names and metadata), DOI resolution data download, and Cited by Link.', 'pid_graph:DB893DE8', NULL, 'TWN', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:723A3E8C', NULL, 'Republic of Türkiye Ministry of Culture and Tourism', 'The Ministry of Culture and Tourism is a government ministry of the Republic of Turkey, responsible for culture and tourism affairs in Turkey.', 'pid_graph:DB893DE8', NULL, 'TUR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:66DB4934', NULL, 'Bodleian Library, University of Oxford', 'The Bodleian Libraries is the library service supporting the University of Oxford. The mission of the Bodleian Libraries is to provide an excellent service to support the learning, teaching and research objectives of the University of Oxford; and to develop and maintain access to Oxford''s unique collections for the benefit of scholarship and society.', 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:692E6BE7', NULL, 'British Library', 'The British Library is the national library of the UK. The library is free to use and open to everyone. It works with partners and other libraries to make its collection as accessible as possible.', 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:8C8A02AB', NULL, 'Cambridge University Library', 'The library of Cambridge University preserves the worlds knowledge in physical and digital form. As one of the UK and Ireland’s six Legal Deposit Libraries, Cambridge University Library has been entitled to request every publication in both the UK and Ireland since 1710. In addition to its physical collections, the library allows access to tens of millions of electronic articles, books, journals, scores and other e-resources.', 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:6ADA1073', NULL, 'National Library of Scotland', 'The National Library of Scotland is answerable to the Scottish Parliament and funded by the Scottish Government. It remains one of only six legal deposit libraries in the United Kingdom and Ireland and is governed by a board of management. Its mission is to enhance Scotland''s international reputation by making a significant contribution to global knowledge and the memory of the world.', 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:591D90E5', NULL, 'National Library of Wales', 'The National Library of Wales (NLW) is a legal deposit library holding a right to a copy of every publication printed in Britain and Ireland. The library is physically located in Abserystwyth but some of its collection has been digitized and can be viewed online.   ', 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:4CA9BB01', NULL, 'UK National Archives', NULL, 'pid_graph:DB893DE8', NULL, 'GBR', NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:A7074BF7', NULL, 'AETIS', 'AETIS is a digital platform designed to support the growth and development of businesses and individuals working in creative industries, such as music, art, design, film, and advertising, by providing them with online tools, and resources, to protect their Intellectual Property Rights almost instantly. AETIS brings together innovative technology and IP protection experts worldwide to lay the foundation for the global expansion of creative industries, culture and innovative businesses.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:4491BAB1', NULL, 'ARK Alliance', 'The ARK Alliance is an open global community supporting the ARK infrastructure on behalf of research and scholarship. Archival Resource Keys (ARKs) serve as persistent identifiers, or stable, trusted references for information objects. Among other things, they aim to be web addresses (URLs) that don’t return 404 Page Not Found errors.', 'pid_graph:FBFDB448', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:78C5DD5E', NULL, 'arXiv.org', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:24B83E30', NULL, 'B2INST', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:508240F7', NULL, 'Bibliographic Data Services', 'Bibliographic Data Services (BDS) aggregates, curates and delivers metadata relating to print and e-books, audiobooks, film, music and video games. BDS also specialises in the design, build, hosting and maintenance of websites for the book trade and home entertainment industry.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:530D0168', NULL, 'Bitbucket', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:01F7DFBA', NULL, 'BSI Identify', 'BSI Identify is a service operated by BSI to provide unambiguous identification for products and the long-term persistent storage of associated product information that can be accessed using a digital ID called a UPIN (Unique Persistent Identification Number). The service provides a consistent approach to identification of construction products that supports the industry as it continues to digitize and addresses critical safety issues.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:C9E0E092', NULL, 'BTLF (Société de gestion de la Banque de Titres de Langue Française)', 'The BLTF management company contributes to improving the marketing of French-language publishing products in Canada and Quebec; fostering the promotion and encouraging the marketing of Canadian and Quebec French-language publishing products abroad; encouraging and fostering communication and collaboration between publishers, booksellers, distributors, librarians and other participants in the book industry.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:33C4D427', NULL, 'Casalini Libri', 'Casalini Libri supplies publications from across Southern Europe to libraries and institutions worldwide. It provides services for libraries and publishers. Its Torrossa platforms aims to simplify acquisitions, licensing, and integration with the library catalogue.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:71572A11', NULL, 'Catalogue of Life (COL)', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:158F1A3C', NULL, 'CLARIN', 'The Common Language Resources and Technology Infrastructure (CLARIN) is a digital infrastructure which provides easy and sustainable access to a broad range of language data and tools to support research in the humanities and social sciences, and beyond. CLARIN provides access to multimodal digital language data (text, audio, video) and advanced tools with which to explore, analyse or combine these datasets.', 'pid_graph:FBFDB448', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:ACA4FB20', NULL, 'Clarivate Analytics', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
