INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:44F64F9F', NULL, 'Consolidated Independent (CI)', 'Consolidated Independent is a London based company connecting labels and artists with the opportunities and services of the global digital market. CI’s position as part of the state51 Music Group provides access to their supply side technology platform. ', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:78CB2A61', NULL, 'Corporation for National Research Initiatives (CNRI)', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:D51999D1', NULL, 'CrossRef', 'Crossref is a global community infrastructure making all kinds of research objects easy to find, assess, and reuse through a number of services critical to research communications. Their 18,000+ members come from 148 countries and their ~140 million DOI records contribute to the collective vision of a rich and reusable open network of relationships connecting research organisations, people, things, and actions; a scholarly record that the global community can build on forever, for the benefit of society.', 'pid_graph:FBFDB448', NULL, NULL, NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:258448F0', NULL, 'DataCite', 'DataCite is a global non-profit organisation that provides DOIs for research data and all other research outputs. By assigning DataCite DOIs, research outputs become discoverable and associated metadata is made available to the community. DataCite develops additional services to make it easy to connect and share research outputs with the broader research ecosystem and to assess the use of outputs within that ecosystem. All organisations within the research community can join DataCite to start registering DOIs.', 'pid_graph:FBFDB448', NULL, NULL, NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:ED720170', NULL, 'Decentralised', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:4F922FE1', NULL, 'Deep Carbon Observatory', 'DCO-ID is the DCO implementation of the Global Handle System (superset of Digital Object Identifier).', 'pid_graph:F1662576', NULL, NULL, NULL, '0000-0002-0255-5101', '2024-08-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:5FB541DE', NULL, 'Deep Carbon Observatory (DCO) (defunct)', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:23DB5BB4', NULL, 'EIDR', 'The Entertainment Identifier Registry (EIDR) provides identification services for Content Identifers and Video Service Identifers. Content IDs are a registry of movies, television shows, radio programs, podcasts, and other audio/video assets of commercial, cultural, historic, or scientific interest. Video Service IDs are a registry of content delivery services including terrestrial broadcast channels, satellite delivery channels, cable television networks, Internet streaming services, etc. EIDR IDs are commonly used for process automation, linked data, engineering standards, academic citation, universal search, and so forth.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:393211A0', NULL, 'Entertainment Identifier Registry Association (EIDR)', NULL, 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2025-01-19');
INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:6FC02CC0', NULL, 'EU-OP', 'The Publications Office of the European Union is the official provider of publishing services to all EU institutions, bodies and agencies. Its mission is to support EU policies as a centre of excellence for information, data and knowledge management, and to ensure that this broad range of information is available to the public as accessible and reusable data to facilitate transparency, economic activity and the diffusion of knowledge.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
