INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:88325889', NULL, 'GRNET', 'Greek Research and Technology Network (GRNET) provides networking, cloud computing, HPC, data management services and e-Infrastructures and services to academic and research institutions, to educational bodies at all levels, and to all agencies of the public sector in Greece.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
