INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:0959C132', NULL, 'Muso.AI', 'Muso.AI is a universal credit database designed to keep up with the digitization of music. Muso.AI is merging and cleaning up the music industry’s metadata and connecting creators with master rights holders to validate credits.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
