INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:20ADCB86', NULL, 'SND', 'The Swedish National Data Service (SND) is one of several national entities implementing the so-called Data Act, which is part of the European Union’s transition to a new system of open science. SND has a mission to create opportunities for researchers to describe, share, and reuse research data. They do this by supporting Swedish higher education institutions and other research organizations in establishing and operating local research data support functions (Data Access Units, DAU).', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
