INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:7475B7DC', NULL, 'SoundExchange Inc.', 'SoundExchange is designated by the U.S. government to administer the Section 114 sound recording license. It collects and distributes digital performance royalties on behalf of 700,000 creators.Using proprietary technology that turns data into revenue SoundExchange has paid more than $11 billion in distributions to date. ', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
