INSERT INTO k_Provider (IDPRV, lodPRV, PRV, labelProvider, descProvider, lodTPR, lodPRV_V, Country, StartDate, populatedBy, lastTouch) VALUES (NULL, 'pid_graph:5F4F4BD6', NULL, 'Switchchord', 'Switchchord is a collective of musicians, lawyers, accountants, technologists, and songwriters dedicated to solving the hardest problems in the music industry. They create split sheets which help protect creatives’ work and income. They also provide metadata insights for publishers.', 'pid_graph:F1662576', NULL, NULL, NULL, '0009-0006-1756-5317', '2024-08-20');
